script: |
  super -f text -I q1985.spq | sort > q1985.out

inputs:
  - name: q1985.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + col1 NOT BETWEEN - col1 - 61 + col2 * col1 + - CAST ( - + col2 AS REAL ) AND + - CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q1985.out
    data: |
